function searchTreinadorEmagrecer() {

  $('#portfolioModal1').modal('hide');
  
  var name = document.querySelector("#nameModal1").value;
  var weight = document.querySelector("#weightModal1").value;
  var age = document.querySelector("#ageModal1").value;

  if(age < 18){ // Criança e adolescente
    if(weight < 50){
      $('#portfolioModal1').on('hidden.bs.modal', function (e) {
        document.getElementById('resultNameModal1Infantil1').innerHTML = name;
        $('#portfolioModal1TreinadorInfantil1').modal('show');
      });
    }
    if(weight >= 50 && weight < 100 ){
      console.log('Entrei no segundo');
      $('#portfolioModal1').on('hidden.bs.modal', function (e) {
        document.getElementById('resultNameModal1Infantil2').innerHTML = name;
        $('#portfolioModal1TreinadorInfantil2').modal('show');
      });
    }
    if(weight >= 100 ){
      console.log('Entrei no terceiro');
      $('#portfolioModal1').on('hidden.bs.modal', function (e) {
        document.getElementById('resultNameModal1Infantil3').innerHTML = name;
        $('#portfolioModal1TreinadorInfantil3').modal('show');
      });
    }
  }

  if(age >= 18 && age < 45){ // Adulto
    if(weight < 50){
      $('#portfolioModal1').on('hidden.bs.modal', function (e) {
        document.getElementById('resultNameModal1Adulto1').innerHTML = name;
        $('#portfolioModal1TreinadorAdulto1').modal('show');
      });
    }
    if(weight >= 50 && weight < 100 ){
      $('#portfolioModal1').on('hidden.bs.modal', function (e) {
        document.getElementById('resultNameModal1Adulto2').innerHTML = name;
        $('#portfolioModal1TreinadorAdulto2').modal('show');
      });
    }
    if(weight > 100 ){
      $('#portfolioModal1').on('hidden.bs.modal', function (e) {
        document.getElementById('resultNameModal1Adulto3').innerHTML = name;
        $('#portfolioModal1TreinadorAdulto3').modal('show');
      });
    }
  }

  if(age >= 45){ // Idoso
    if(weight < 50){
      $('#portfolioModal1').on('hidden.bs.modal', function (e) {
        document.getElementById('resultNameModal1Idoso1').innerHTML = name;
        $('#portfolioModal1TreinadorIdoso1').modal('show');
      });
    }
    if(weight >= 50 && weight < 100 ){
      $('#portfolioModal1').on('hidden.bs.modal', function (e) {
        document.getElementById('resultNameModal1Idoso2').innerHTML = name;
        $('#portfolioModal1TreinadorIdoso2').modal('show');
      });
    }
    if(weight > 100 ){
      $('#portfolioModal1').on('hidden.bs.modal', function (e) {
        document.getElementById('resultNameModal1Idoso3').innerHTML = name;
        $('#portfolioModal1TreinadorIdoso3').modal('show');
      });
    }
  }
}

